{{Infobox dungeon |name = Lakeside Cave |image = [[File:Lakeside Cave.png|thumb]] |caption = A map of Lakeside Cave. |tokens = 1,750,000 |location = South of Rock Peak Ruins, northeast of Ballimere Lake }} '''Lakeside Cave''' is a [[Dungeons|dungeon]] in [[Galar]]. It initially has 125 tiles arranged in two floors: 10x10 and 6x6 in size, respectively; including 16 chest tiles, 38 non-boss encounter tiles, 1 ladder tile, and 1 boss encounter tile. Wild Encounters have 33,216,830 HP.
